import React from 'react'

export default function PostsCard({data}) {
  return (
<div className="card my-2"  style={{borderRadius:"0px"}}>
  <img style={{borderRadius:"0px"}} className="card-img-top" src="https://images.unsplash.com/photo-1586339393565-32161f258eac?auto=format&fit=crop&q=80&w=2070&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D" alt="Card image cap" />
  <div className="card-body">
    <h5 className="card-title">{data.title}</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>
  )
}
